import classes from './Card.module.css'
import { Link } from 'react-router-dom';


const Card = (props) => {

    return (
        <div className={classes.card}>
            <Link to={`props.id`}> <h3>{props.title}</h3></Link>
            <p>{props.location}</p>
            <p>{props.type}</p>
            <p>{props.description}</p>
        </div>
    )

}


export default Card
